// used to create the router of the whole project

import VueRouter from 'vue-router'
import SearchInput from '../pages/SearchInput.vue'
import SmallSearchInput from '../pages/SmallSearchInput.vue'

export default new VueRouter({
    routes:[
        { 
            path:'/about',
            component: SearchInput
        },
        {
            path:'/home',
            component: SmallSearchInput
        }
    ]
})
